import image from '../images/bottles-image.jpg'

function ProductImage() {
  return (
    <div class="image-item">
    <img src={ image } alt="description of Image-1" />
    <h2>Bottle</h2>
    <p>Bottle Description</p>
    <p>Price: $ 310</p>
  </div>
  )
}

export default ProductImage
